import styled from 'styled-components';



export const Box=styled.div`
background-color:white;
width:70%;
height:60vh;
position:absolute;
top:20px;
margin: 5% 15%;
box-shadow:0px 5px 15px black;
`

export const User=styled.div`
display:flex;
font-weight:bold;
font-size:30px;
padding:20px;


`
